//TASK-3

async function fetchUserData(){
    let response = await fetch("https://jsonplaceholder.typicode.com/users");
    let data = await response.json()
    console.log(data)
    data.forEach((user) => {
        container.innerHTML += `<div class="rounded-xl p-5 w-[500px] m-5  bg-white shadow-2xl">
        <div class="flex justify-between">
            <p class="text-3xl font-bold " >${user.name}</p>
            <p class="text-blue-800 underline mt-2 cursor-pointer">${user.username}</p>
        </div>
        <p class="text-2xl font-semibold mt-2">${user.phone}</p>
        <p class="text-blue-800 underline cursor-pointer mt-2">${user.email}</p>
        <p class="text-lg mt-2">${user.address.city}, ${user.address.street}, ${user.address.zipcode}</p>
        <p class="rounded-lg bg-blue-400 text-lg font-bold w-fit px-2 p-1 mt-2 text-white">${user.company.name}</p>
        </div>`;
    });
}

fetchUserData()
